import React, { FC } from "react";

interface Props {
  title: string;
}
const FilmItem: FC<Props> = ({ title }) => {
  return (
    <div>
      <h3> {title}</h3>
      <style jsx>{`
        div {
          padding: 4px 20px;
          border: solid 1px rgba(20, 20, 20, 0.1);
        }
      `}</style>
    </div>
  );
};

export default FilmItem;
